import Accordion from "react-bootstrap/Accordion";
import "./accord.css";
export default function Accord({ props }) {
  console.log(props);
  return (
    <div className="row">
    <Row className="row">
      <Card className="card">
        <Card.Body>{props.title}</Card.Body>
      </Card>
    </Row></div>
  );
}
